89384;instagram;2019-01-05 15:33:06;FALSE;meanwhile:my reflections on this lifetime documentary series as sparked a lot of dialogue which needs to be had in the black community. my thoughts sexual abuse is that open secret within black communities that has been minimised and normalised by a certain generation and minimalised when exposed. often the victims grow up to be highly sexualised and inappropriate adults. enter these damaged abused black women who are die hard r kelly fans who can not separate their own experiences from the reality which is the deepest darkest, premeditated acts of sexual abuse. they are unable to separate the artist from the perpetrator because they have this stockholm syndrome approach their perceptions are for the most part largely & consciously distorted. this is a cancer that needs extermination. it starts with the truth in 2019. #survivingrkelly 🎓💯 lets talk about it, it’s time. so much happening checkout my blog on instagram rainbow blak celebrating the best in music,creativity,music producers, art etc 📸🎵🎭🎨 rainbow blak taking micro blogging to a whole new level:lookout for more great features:thanku for supporting my blog 👏🏾👏🏾👏🏾❤️#instagramers rainbow blak:the brainchild behind rainbow blak no team just me & my creativity.the struggle is real 🎓 blog with teeth:rainbow blak str8 outta london bloggologist since 2008 creative visionary rainbow blak.support this rainbow blak undiscovered artist, bloggologist, social commentator, certified music junkie, photographer, writer, amateur film maker & creative therapist ❤️ new mind candy follow rainbow blak on instagram for something that looks like mind candy. thanku to everybody for the ❤️ so far. follow rainbow blak on twitter.  #blackart #musicjunkie #music #women  #rainbowblak #london #art #bloggerlife #londonlife #birminghamlife #femalepodcaster #podcasting #podcastlife #sexualabuse #sexualconsent #emotionalabuse #control #relationships #psychologicalabuse #womenempowerment #womensrights 